import Logo from '.';
import OpcoesHeader from '../OpcoesHeader';
import IconesHeader from '../IconesHeader';


function Header (){

    return (
        <div className="App-header">
            <Logo className = 'logo' />
            <OpcoesHeader className = 'opcoes' />
            <IconesHeader className = 'icones' />
        </div>
    )
}

export default Header
